INSERT INTO `teams` (`id`, `name`, `designation`, `subTeam`, `quote`, `image`, `createdAt`, `updatedAt`) VALUES
(1, 'Sarath Chandran', 'Chair', 'Main', 'You know you’re in love when you can’t fall asleep because reality is finally better than your dreams.', 'profile.jpg', '2018-08-25 16:37:51', '2018-08-25 16:37:51'),
(2, 'Albin Antony', 'Vice Chair', 'Main', 'I’m selfish, impatient and a little insecure. I make mistakes, I am out of control and at times hard to handle. But if you can’t handle me at my worst, then you sure as hell don’t deserve me at my best', 'profile.jpg', '2018-08-25 16:40:00', '2018-08-25 00:00:00'),
(3, 'Jessal VA', 'Treasurer', 'Main', 'Get busy living or get busy dying.', 'profile.jpg', '2018-08-25 16:40:00', '2018-08-25 16:40:00'),
(4, 'Paul Ajith', 'General Secretary', 'Main', 'The first step toward success is taken when you refuse to be a captive of the environment in which you first find yourself.', 'profile.jpg', '2018-08-25 16:43:16', '2018-08-25 16:43:16'),
(5, 'Nirmal Thomas', 'Coding Cell Chair', 'Coding', 'When one door of happiness closes, another opens; but often we look so long at the closed door that we do not see the one which has been opened for us.', 'profile.jpg', '2018-08-25 16:43:16', '2018-08-25 16:43:16'),
(6, 'Chris Humphrey', 'Women Cell Chair', 'Women', 'Twenty years from now you will be more disappointed by the things that you didn’t do than by the ones you did do.', 'profile.jpg', '2018-08-25 16:50:00', '2018-08-25 16:50:00'),
(7, 'Abhijith Nandagopal', 'CSE Department Representative', 'DepRep', 'When I dare to be powerful – to use my strength in the service of my vision, then it becomes less and less important whether I am afraid.', 'profile.jpg', '2018-08-25 16:50:00', '2018-08-25 16:50:00'),
(8, 'Gopal M', 'Web Team Lead', 'Web', 'Great minds discuss ideas; average minds discuss events; small minds discuss people.', 'profile.jpg', '2018-08-25 16:51:08', '2018-08-25 16:51:08'),
(9, 'Abhishek Nambiar', 'Technical Coordinator', 'Tech', 'A successful man is one who can lay a firm foundation with the bricks others have thrown at him.', 'profile.jpg', '2018-08-25 19:38:15', '2018-08-25 19:38:15'),
(10, 'Sarath Sreedhar', 'Project Coordinator', 'Project', 'Those who dare to fail miserably can achieve greatly.\r\n', 'profile.jpg', '2018-08-25 19:40:41', '2018-08-25 19:40:41'),
(11, 'Joyce Varghese', 'Membership Coordinator', 'Membership', 'I can’t give you a sure-fire formula for success, but I can give you a formula for failure: try to please everybody all the time.\r\n', 'profile.jpg', '2018-08-25 19:40:41', '2018-08-25 19:40:41'),
(12, 'Mathew George', 'Coding Cell Vice Chair', 'Coding', 'It is hard to fail, but it is worse never to have tried to succeed.\r\n', 'profile.jpg', '2018-08-25 22:08:15', '2018-08-25 22:08:15'),
